var blogFormat=[{selector:"#blogCardTitle-",tag:"title",dom:(e,t)=>document.querySelector(e).innerHTML=t},{selector:"#blogCardSubTitle-",tag:"pubDate",dom:(e,t)=>document.querySelector(e).innerHTML=t},{selector:"#blogLink-",tag:"link",dom:(e,t)=>document.querySelector(e).href=t}];new Vue({beforeCreate:()=>fetch("https://blog.kanofoundation.id/index.xml").then(e=>e.text()).then(e=>(new window.DOMParser).parseFromString(e,"text/xml")).then(e=>{for(var t=1;t<5;t++)blogFormat.forEach(o=>o.dom(o.selector+t,e.getElementsByTagName(o.tag)[t].childNodes[0].nodeValue))}).catch(e=>console.log(e))}),document.querySelectorAll("[data-bss-baguettebox]").length>0&&baguetteBox.run("[data-bss-baguettebox]",{animation:"slideIn"});